// Importez les composants que vous souhaitez utiliser comme pages
import Vue from 'vue'
import { createApp } from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'
import Auth from './components/Authentification/AuthentificationUser.vue'
import Home from './components/HelloWorld.vue' // Importez le composant de la page d'accueil

Vue.config.productionTip = false

Vue.use(VueRouter);

const routes = [
  { path: '/', component: Auth }, // Itinéraire pour la page d'authentification
  { path: '/home', component: Home } // Itinéraire pour la page d'accueil
];

const router = new VueRouter({
  routes
});

//createApp(App).use(router).mount('#app');

new Vue({
  render: (h) => h(App),
  router,
}).$mount('#app');
